const AdvancedSidebar = ({
  selectedProvince,
  setSelectedProvince,
  selectedCity,
  setSelectedCity,
  locationData,
  currentData,
  currentLocationName,
  totalCount
}) => {
  const handleProvinceChange = (value) => {
    setSelectedProvince(value);
    setSelectedCity(null);
  };

  return (
    <div style={{ 
      position: 'absolute',
      top: '20px',
      left: '20px',
      width: '360px',
      maxHeight: 'calc(100vh - 40px)',
      minWidth: 0,
      minHeight: 0,
      zIndex: 1100,
      backgroundColor: 'rgba(44, 62, 80, 0.95)',
      color: 'white',
      padding: '20px',
      borderRadius: '12px',
      boxShadow: '0 4px 20px rgba(0,0,0,0.3)',
      overflowY: 'auto',
      backdropFilter: 'blur(10px)'
    }}>
      <h1 style={{ fontSize: '22px', marginBottom: '8px', fontWeight: 'bold' }}>
        🦌 로드킬 분석
      </h1>
      <p style={{ fontSize: '13px', color: '#bdc3c7', marginBottom: '20px' }}>
        지역별 동물 로드킬 현황
      </p>

      {/* 시도 선택 */}
      <div style={{ marginBottom: '15px' }}>
        <label style={{ display: 'block', marginBottom: '8px', fontSize: '13px', fontWeight: 'bold' }}>
          📍 시/도
        </label>
        <select
          value={selectedProvince}
          onChange={(e) => handleProvinceChange(e.target.value)}
          style={{
            width: '100%',
            padding: '10px',
            fontSize: '14px',
            borderRadius: '8px',
            border: 'none',
            backgroundColor: '#34495e',
            color: 'white',
            cursor: 'pointer'
          }}
        >
          {Object.keys(locationData).map((province) => (
            <option key={province} value={province}>
              {locationData[province].name}
            </option>
          ))}
        </select>
      </div>

      {/* 시군구 선택 */}
      {locationData[selectedProvince].cities && (
        <div style={{ marginBottom: '15px' }}>
          <label style={{ display: 'block', marginBottom: '8px', fontSize: '13px', fontWeight: 'bold' }}>
            🏘️ 시/군/구
          </label>
          <select
            value={selectedCity || ''}
            onChange={(e) => setSelectedCity(e.target.value || null)}
            style={{
              width: '100%',
              padding: '10px',
              fontSize: '14px',
              borderRadius: '8px',
              border: 'none',
              backgroundColor: '#34495e',
              color: 'white',
              cursor: 'pointer'
            }}
          >
            <option value="">전체</option>
            {Object.keys(locationData[selectedProvince].cities).map((city) => (
              <option key={city} value={city}>
                {city}
              </option>
            ))}
          </select>
        </div>
      )}

      {/* 통계 */}
      <div style={{
        backgroundColor: 'rgba(52, 73, 94, 0.8)',
        padding: '15px',
        borderRadius: '8px',
        marginBottom: '15px'
      }}>
        <div style={{ fontSize: '12px', color: '#bdc3c7', marginBottom: '5px' }}>
          {currentLocationName}
        </div>
        <div style={{ fontSize: '28px', fontWeight: 'bold', color: '#e74c3c' }}>
          {totalCount.toLocaleString()}건
        </div>
      </div>

      {/* 동물별 순위 */}
      <div>
        <h3 style={{ fontSize: '14px', marginBottom: '12px', fontWeight: 'bold' }}>
          동물별 발생 건수
        </h3>
        {currentData.map((item, index) => (
          <div key={item.animal} style={{
            backgroundColor: 'rgba(52, 73, 94, 0.6)',
            padding: '10px',
            borderRadius: '6px',
            marginBottom: '6px',
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center'
          }}>
            <div style={{ display: 'flex', alignItems: 'center', gap: '8px' }}>
              <span style={{
                backgroundColor: index === 0 ? '#e74c3c' : '#95a5a6',
                width: '22px',
                height: '22px',
                borderRadius: '50%',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                fontSize: '11px',
                fontWeight: 'bold'
              }}>
                {index + 1}
              </span>
              <span style={{ fontSize: '13px' }}>{item.animal}</span>
            </div>
            <span style={{ fontSize: '14px', fontWeight: 'bold', color: '#e74c3c' }}>
              {item.count}건
            </span>
          </div>
        ))}
      </div>
    </div>
  );
};

export default AdvancedSidebar;
